    public static  int[] numSmallerByFrequency(String[] queries, String[] words) {
        System.out.println(queries.length);
        if (queries==null || words==null||queries.length==0||words.length==0){
            return new int[]{};
        }
        int res[] = new int[queries.length];
        for (int i = 0;i< queries.length;i++) {
            int qMinChar = minCharNum(queries[i]);
            int resQ = 0;
            for (String w : words) {
                int wMinChar = minCharNum(w);
                if (qMinChar < wMinChar) {
                    resQ = resQ+1;
                }
            }
            res[i] = resQ;
        }
        return res;
    }

    private static int minCharNum(String str) {
        if (str.length()==0){
            return 0;
        }
        // 统计str中的最小字符的个数
        Map<Character,Integer> map = new HashMap<>();
//        char[] arr = new char[str.length()];
        for(int i = 0;i<str.length();i++) {
            if (map.get(str.charAt(i))!=null) {
                map.put(str.charAt(i),map.get(str.charAt(i))+1);
            } else {
                if (map.size()>0){
                    for (Map.Entry<Character,Integer> m : map.entrySet()) {
                        if(m.getKey()>str.charAt(i)) {
                            map.remove(m.getKey());
                            map.put(str.charAt(i),1);
                        }
                    }
                }else {
                    map.put(str.charAt(i),1);
                }
            }
//            arr[i] = str.charAt(i);
        }
//      对str进行排序
//        Arrays.sort(arr);
//      统计出最小字符的个数
        int res = 0;
        for (Map.Entry<Character,Integer> m : map.entrySet()) {
            res = m.getValue();
        }
        return res;
    }
